import React from "react";
import DataItem from "./DataItem";

const DataList = ({ data, onEdit, onDelete }) => {
    return (
        <div>
            {data.map((item) => (
                <DataItem key={item.id} item={item} onEdit={onEdit} onDelete={onDelete} />
            ))}
        </div>
    );
};

export default DataList;
